import React from 'react';
import { 
    Box, 
    Container, 
    Grid, 
    Card, 
    CardContent,
    Typography,
    IconButton,
    Tooltip,
    Button,
    Divider
} from '@mui/material';
import AddIcon from '@mui/icons-material/Add';
import CalendarTodayIcon from '@mui/icons-material/CalendarToday';
import AssignmentIcon from '@mui/icons-material/Assignment';
import ChatIcon from '@mui/icons-material/Chat';
import AutoGraphIcon from '@mui/icons-material/AutoGraph';
import AssistantIcon from '@mui/icons-material/Assistant';
import { motion } from 'framer-motion';

function Dashboard() {
    return (
        <Box
            sx={{
                minHeight: '100vh',
                background: '#000000',
                py: 4,
                position: 'relative',
                '&::before': {
                    content: '""',
                    position: 'absolute',
                    top: 0,
                    right: 0,
                    width: '50%',
                    height: '50%',
                    background: 'radial-gradient(circle, rgba(220, 20, 60, 0.15) 0%, transparent 70%)',
                    filter: 'blur(80px)',
                    pointerEvents: 'none'
                }
            }}
        >
            <Container maxWidth="xl">
                <motion.div
                    initial={{ opacity: 0, y: -20 }}
                    animate={{ opacity: 1, y: 0 }}
                    transition={{ duration: 0.5 }}
                >
                    <Card
                        sx={{
                            mb: 4,
                            background: 'rgba(255, 255, 255, 0.02)',
                            backdropFilter: 'blur(20px)',
                            borderRadius: '24px',
                            border: '1px solid rgba(255, 255, 255, 0.05)',
                            boxShadow: 'none',
                        }}
                    >
                        <CardContent sx={{ p: { xs: 2, md: 4 } }}>
                            <Box sx={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', mb: 3 }}>
                                <Typography variant="h4" sx={{ 
                                    display: 'flex', 
                                    alignItems: 'center', 
                                    gap: 2,
                                    color: '#fff',
                                    fontWeight: 600,
                                    fontSize: { xs: '1.5rem', md: '2rem' }
                                }}>
                                    <ChatIcon sx={{ color: '#DC143C', fontSize: { xs: 30, md: 40 } }} />
                                    AI Study Assistant
                                </Typography>
                                <Button
                                    variant="contained"
                                    startIcon={<AssistantIcon />}
                                    sx={{
                                        background: 'linear-gradient(45deg, #DC143C, #FF4D6A)',
                                        borderRadius: '12px',
                                        textTransform: 'none',
                                        fontSize: '0.95rem',
                                        px: 3,
                                        py: 1.5,
                                        '&:hover': {
                                            background: 'linear-gradient(45deg, #DC143C, #FF4D6A)',
                                            transform: 'translateY(-2px)',
                                            boxShadow: '0 5px 15px rgba(220, 20, 60, 0.3)',
                                        }
                                    }}
                                >
                                    Open Assistant
                                </Button>
                            </Box>
                            <Divider sx={{ my: 3, bgcolor: 'rgba(255, 255, 255, 0.05)' }} />
                            <Grid container spacing={4}>
                                <Grid item xs={12} md={8}>
                                    <Typography variant="h6" color="rgba(255, 255, 255, 0.7)" gutterBottom>
                                        Current Study Plan
                                    </Typography>
                                    <Box sx={{ mt: 2 }}>
                                        {/* Study plan content will go here */}
                                    </Box>
                                </Grid>
                                <Grid item xs={12} md={4}>
                                    <Typography variant="h6" color="rgba(255, 255, 255, 0.7)" gutterBottom>
                                        Study Metrics
                                    </Typography>
                                    {/* Real-time metrics will go here */}
                                </Grid>
                            </Grid>
                        </CardContent>
                    </Card>
                </motion.div>

                <Grid container spacing={3}>
                    {['Schedule Manager', 'Task Manager', 'Study Analytics'].map((title, index) => (
                        <Grid item xs={12} md={4} key={title}>
                            <motion.div
                                initial={{ opacity: 0, y: 20 }}
                                animate={{ opacity: 1, y: 0 }}
                                transition={{ duration: 0.5, delay: index * 0.2 }}
                            >
                                <Card
                                    sx={{
                                        height: '100%',
                                        background: 'rgba(255, 255, 255, 0.02)',
                                        backdropFilter: 'blur(20px)',
                                        borderRadius: '24px',
                                        border: '1px solid rgba(255, 255, 255, 0.05)',
                                        boxShadow: 'none',
                                        transition: 'transform 0.2s, box-shadow 0.2s',
                                        '&:hover': {
                                            transform: 'translateY(-5px)',
                                            boxShadow: '0 8px 25px rgba(220, 20, 60, 0.15)',
                                        }
                                    }}
                                >
                                    <CardContent sx={{ height: '100%', p: { xs: 2, md: 4 } }}>
                                        <Box sx={{ 
                                            display: 'flex', 
                                            justifyContent: 'space-between', 
                                            alignItems: 'center', 
                                            mb: 3 
                                        }}>
                                            <Typography variant="h5" sx={{ 
                                                display: 'flex', 
                                                alignItems: 'center', 
                                                gap: 1.5,
                                                color: '#fff',
                                                fontWeight: 500,
                                                fontSize: { xs: '1.25rem', md: '1.5rem' }
                                            }}>
                                                {index === 0 && <CalendarTodayIcon sx={{ color: '#DC143C', fontSize: 28 }} />}
                                                {index === 1 && <AssignmentIcon sx={{ color: '#DC143C', fontSize: 28 }} />}
                                                {index === 2 && <AutoGraphIcon sx={{ color: '#DC143C', fontSize: 28 }} />}
                                                {title}
                                            </Typography>
                                            {index !== 2 && (
                                                <Tooltip title={`Add ${title.split(' ')[0]}`}>
                                                    <IconButton 
                                                        sx={{ 
                                                            color: '#DC143C',
                                                            '&:hover': {
                                                                background: 'rgba(220, 20, 60, 0.1)',
                                                            }
                                                        }}
                                                    >
                                                        <AddIcon />
                                                    </IconButton>
                                                </Tooltip>
                                            )}
                                        </Box>
                                        {/* Existing content placeholders remain */}
                                    </CardContent>
                                </Card>
                            </motion.div>
                        </Grid>
                    ))}
                </Grid>
            </Container>
        </Box>
    );
}

export default Dashboard;
